import React from "react";
import {
  Container,
  Text,
  CommandButton,
  PrimaryButton,
  SearchInput,
  OutlinedButton,
  ActionButton,
} from "../../styledComponents";
import styled from "styled-components";
import HouseItem from "../HouseItem";
import CreateHouse from "./create/CreateHouse";

const SearchWrapper = styled(Container)`
  display: flex;
  width: 100%;
  flex-direction: row;
  padding: 30px 110px;
  background-color: white;
`;
const Wrapper = styled(Container)`
  display: flex;
  flex-direction: column;
  width: 100%;
  padding: 0px 110px;
`;
const ActionBtn = styled(ActionButton)`
  display: flex;
  justify-content: center;
  align-items: center;
  align-content: center;
  padding-right: 10px;
  padding-left: 10px;
  border-radius: 2px;
  background-color: ${({ theme }) => theme.lightGrey};
`;
const Houses = (props) => {
  console.log(props.houses);
  return (
    <Container flex={1}>
      <SearchWrapper>
        <Container flex={1} color="transparent">
          <SearchInput
            placeholder="Find ?"
            customStyles={{ width: "80%" }}
          />
        </Container>

        <PrimaryButton customStyles={{ width: 150, fontSize: 18 }}>
          Search
        </PrimaryButton>
      </SearchWrapper>
      <Wrapper>
        <Container
          right
          center
          row
          customStyles={{ paddingTop: 10, paddingBottom: 10 }}
        >
          <CreateHouse />
        </Container>
        <Container flex={1} row customStyles={{ flexWrap: "wrap" }}>
          {props.houses &&
            props.houses.map((house) => {
              return <HouseItem key={house.id} house={house} {...props} />;
            })}
        </Container>
      </Wrapper>
    </Container>
  );
};

export default Houses;
